    rules, and did not use any of this money for federal purposes. 2. We have carefully
    reviewed the definition of ''Federal Election Activity'' and have determined that
    payments for ''slate card distribution'' did not meet those criteria.  The payments
    were properly disclosed on Schedule H4. 3. The payments for ''slate card distribution''
